.search-result {
    background-color: #314a57;
    padding: 20px 35px 55px;
    min-height: 100vh;
    display: flex;
    flex-direction: column;
    align-items: center;
    width: 100%;
  }
  
  .login-section {
    width: 100%;
    height: 67px;
    display: flex;
  }
  
  .login-image {
    margin: 20px;
    height: 67px;
    object-fit: contain;
  }
  
  .search-section-padding {
    margin-top: 20px;
    display: flex;
    flex-direction: column;
    gap: 30px;
    width: 100%;
    max-width: 1301px;
  }
  
  .search-section {
    display: flex;
    justify-content: center;
    width: 100%;
  }
  
  .name-title {
    font-family: 'JetBrains Mono', monospace;
    font-weight: 700;
    font-size: 40px;
    color: #ffffff;
    margin: 0;
  }
  
  .description-container {
    display: flex;
    flex-direction: column;
    gap: 20px;
    width: 100%;
  }
  
  .description-text {
    font-family: 'JetBrains Mono', monospace;
    font-weight: 700;
    font-size: 20px;
    letter-spacing: 2.8px;
    color: #ffffff;
    margin: 0;
    line-height: 1.5;
    white-space: pre-wrap;
  }
  
  .search-bars {
    width: 100%;
    margin-top: 10px;
  }
  
  .name-bar {
    width: 100%;
    height: 73px;
    display: flex;
    justify-content: center;
  }
  
  .search-frame {
    width: 1301px;
    height: 68px;
    background-color: #243541;
    padding: 21px 38px;
    display: flex;
    align-items: center;
  }
  
  .search-placeholder {
    font-family: 'JetBrains Mono', monospace;
    font-weight: 300;
    font-size: 20px;
    color: #ffffff;
  }
